import CategoryPage from '../category/category.component';

const ShopPage = (props) => {
    
    const params = useParams()
    return (
        <div className="shop-page" >        
            {console.log(props.match)}
            <Route exact path='/shop'element={<CollectionsOverview />} />
            <Route exact path='/shop'element={<CollectionsOverview />} />
            {/* <CollectionsOverview /> */}
